(3,'Orientasi Pelayanan','Pada umumnya dapat menyelesaikan tugas pelayanan dengan baik dan sikap sopan serta memuaskan baik untuk pelayanan internal maupun eksternal organisasai.'),
(8,'Integritas','Pada umumnya dalam melaksanakan tugas bersikap jujur, ikhlas, dan tidak pernah menyalahgunakan wewenangnya tetapi berani menanggung risiko dari tindakan yang dilakukannya.'),
(9,'Komitmen','Adakalanya berusaha dengan sungguh-sungguh menegakkan ideologi negara pancasila, Undang-Undang Dasar Negara Republik Indonesia Tahun 1945, Negara Kesatuan Republik Indonesia (NKRI), Bhineka Tunggal Ika dan rencana-rencana pemerintah dengan tujuan untuk dapat melaksanakan tugasnya secara berdaya guna dan berhasil guna berhasil guna serta mengutamakan kepentingan kedinasan daripada kepentingan pribadi dan/atau golongan sesuai dengan tugas, fungsi, dan tanggung jawabnya sebagai unsur aparatur negara terhadap organisasi tempat dimana ia bekerja.'),
(10,'Disiplin','Pada umumnya mentaati peraturan perundang-undangan dan/atau peraturan kedinasan yang berlaku dengan rasa tanggung jawab, mentaati ketentuan jam kerja serta mampu menyimpan dan/atau memelihara barang-barang milik negara yang dipercayakan kepadanya dengan baik.'),
(11,'Kerjasama','Pada umumnya mampu bekerjasama dengan rekan kerja, atasan, bawahan baik di dalam maupun di luar organisasi serta menghargai dan menerima pendapat orang lain, bersedia menerima keputusan yang diambil secara sah yang telah menjadi keputusan bersama.'),
(12,'Kepemimpinan','Adakalanya bertindak tegas dan tidak memihak, memberikan teladan, cukup mampu menggerakkan tim kerja untuk mencapai kinerja yang tinggi, serta cukup mampu menggugah semangat dan menggerakkan bawahan dalam melaksanakan tugas serta cukup mampu mengambil keputusan dengan cepat dan tepat.');
